import React from 'react';
import { ListGroup } from 'react-bootstrap';

export default function Car (props){
  return(
    <ListGroup horizontal>
      <ListGroup.Item>{props.car.regNr}</ListGroup.Item>
      <ListGroup.Item>{props.car.vehicleId}</ListGroup.Item>
      <ListGroup.Item>{props.car.parked}</ListGroup.Item>
    </ListGroup>
  )
}
